import React from "react";

function SignUp() {
  return (
    <div className="flex h-screen items-center justify-center bg-teal-400">
      <div className="bg-teal-200 p-10 rounded shadow-md w-96">
        <h2 className="text-center text-2xl font-semibold mb-4">Helpdesk System</h2>
        <p className="text-center mb-4">Sign up here</p>
        <input type="text" placeholder="Username" className="w-full mb-3 p-2 border" />
        <input type="password" placeholder="Password" className="w-full mb-3 p-2 border" />
        <input type="email" placeholder="Email" className="w-full mb-4 p-2 border" />
        <button className="w-full bg-blue-600 text-white py-2 rounded">Sign Up</button>
        <div className="text-right mt-2 text-sm">
          <a href="/" className="text-black">Sign In</a>
        </div>
      </div>
    </div>
  );
}

export default SignUp;
